pyright (c) 2020-2022 Universit\u00e9 de Versailles Saint-Quentin-en-Yvelines\n#\n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\n# from deisa import Deisa\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    # Construct a lazy task graph\n    cpt = Derivee(gt, 1).mean()\n\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_ANALYTICS_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"data_source":{"id":"1150"},"glyph":{"id":"1171"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1173"},"nonselection_glyph":{"id":"1172"},"view":{"id":"1175"}},"id":"1174","type":"GlyphRenderer"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1514","type":"AdaptiveTicker"},{"attributes":{"source":{"id":"1110"}},"id":"1136","type":"CDSView"},{"attributes":{},"id":"1445","type":"AllLabels"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - -----------------------------------------------&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Clear task state&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO -   Scheduler at:      tcp://10.7.0.10:8786&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO -   dashboard at:            10.7.0.10:8787&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-6b728a9d-0a5b-11ee-82e3-0894ef968776&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-6b728b78-0a5b-11ee-82e4-0894ef968776&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-6b729599-
